import { Block } from 'baseui/block';

export const Icon = ({ $size, $color = 'inherit', ...rest }) => {
    let w = '16px';
    let h = '16px';
    switch ($size) {
        case 'sm': w = '12px'; h = '12px'; break;
        case 'lg': w = '20px'; h = '20px'; break;
        case 'xl': w = '24px'; h = '24px'; break;
        case '2xl': w = '28px'; h = '28px'; break;
        case '3xl': w = '32px'; h = '32px'; break;
        case 'full': w = '100%'; h = '100%'; break;
        case 'md':
        default:
            break;
    }
    return <Block display='flex' alignItems='center' justifyContent='center' width={w} height={h} color={$color} {...rest} />;
}

